"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Congenital hernia of the diaphragm (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/congenital-hernia-of-the-diaphragm-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H12979096\">",
"      <span class=\"h1\">",
"       What is a congenital hernia of the diaphragm?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A congenital hernia of the diaphragm is a condition that happens when a baby is growing in the mother&rsquo;s uterus (womb).",
"     </p>",
"     <p>",
"      This condition affects the diaphragm, the layer of muscle that separates the organs in the chest from the organs in the belly. Babies with a congenital hernia of the diaphragm have a hole in their diaphragm. Because of this, some of the organs from the belly can move through this hole into the chest (",
"      <a class=\"graphic graphic_figure graphicRef82792 \" href=\"UTD.htm?26/44/27331\">",
"       figure 1",
"      </a>",
"      ). In the chest, these organs can press on the lungs and keep them from growing normally.",
"     </p>",
"     <p>",
"      A congenital hernia of the diaphragm can be mild or severe. A severe congenital hernia of the diaphragm is life-threatening.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12979111\">",
"      <span class=\"h1\">",
"       What are the symptoms of a congenital hernia of the diaphragm?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Before birth, a congenital hernia of the diaphragm causes no symptoms. The doctor might find out your baby has it when he or she does a routine test, called an ultrasound, to check on your baby during pregnancy. An ultrasound is an imaging test that creates pictures of your baby inside the uterus.",
"     </p>",
"     <p>",
"      After birth, the most common symptom that a baby might have is trouble breathing. This usually starts within a few hours after birth. Some babies have mild trouble breathing, but most babies have severe trouble breathing.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12979126\">",
"      <span class=\"h1\">",
"       Is there a test for a congenital hernia of the diaphragm?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor can do a chest X-ray to check if your baby has this condition.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12979141\">",
"      <span class=\"h1\">",
"       How is a congenital hernia of the diaphragm treated during pregnancy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;During pregnancy, your doctor will monitor your baby&rsquo;s health with regular tests. But there is no treatment for this condition during pregnancy.",
"     </p>",
"     <p>",
"      As your due date nears, your doctor will probably talk with you about giving you medicines to help start your labor. Doctors call this &ldquo;inducing labor.&rdquo; Doctors usually induce labor when a baby has a congenital hernia of the diaphragm. That way, the doctors who take care of your baby can be ready to start treatment right after birth.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12979156\">",
"      <span class=\"h1\">",
"       How is a congenital hernia of the diaphragm treated after birth?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on your baby&rsquo;s symptoms and how severe the condition is. It usually involves different steps.",
"     </p>",
"     <p>",
"      First, the doctor will treat your baby&rsquo;s breathing and other lung problems. Treatments usually include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A breathing tube &ndash; A breathing tube is a tube that goes down the throat and into the lungs. The other end is attached to a machine that helps with breathing.",
"       </li>",
"       <li>",
"        A nasogastric tube &ndash; This is a thin tube that goes in the nose and down into the stomach. The tube sucks up extra fluid and air in the stomach.",
"       </li>",
"       <li>",
"        An IV &ndash; This is a thin tube that goes into a vein.",
"       </li>",
"       <li>",
"        An umbilical line &ndash; This is a thin tube that goes into a blood vessel in the umbilical cord.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If the breathing tube doesn&rsquo;t help enough, your baby might need to be put on a heart and lung machine. This machine, which doctors call &ldquo;ECMO,&rdquo; takes over the jobs of the heart and lungs. It pumps blood from your baby&rsquo;s body, gives it oxygen, and pumps it back into the body.",
"     </p>",
"     <p>",
"      After your baby&rsquo;s breathing and other lung problems are under control, he or she will need surgery. Surgery is usually done a few days after birth, but the timing depends on your baby&rsquo;s individual situation. During surgery, the doctor will put the belly organs back in the belly and close the hole in the diaphragm.",
"     </p>",
"     <p>",
"      After surgery, babies usually need a breathing tube or to be on a heart and lung machine while they heal.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12979171\">",
"      <span class=\"h1\">",
"       Does a congenital hernia of the diaphragm cause long-term problems?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes. It will depend on your baby&rsquo;s individual situation. But many babies with a congenital hernia of the diaphragm will have long-term problems. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Breathing or other lung problems",
"       </li>",
"       <li>",
"        Not gaining weight or growing normally",
"       </li>",
"       <li>",
"        Digestive problems",
"       </li>",
"       <li>",
"        Learning problems or hearing loss",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12979186\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?33/16/34050?source=see_link\">",
"       Patient information: Going home from the hospital (The Basics)",
"      </a>",
"     </p>",
