"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Primary hyperparathyroidism (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/primary-hyperparathyroidism-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H25992201\">",
"      <span class=\"h1\">",
"       What is hyperparathyroidism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hyperparathyroidism is a disorder of the parathyroid glands in your neck (",
"      <a class=\"graphic graphic_figure graphicRef66834 \" href=\"UTD.htm?14/43/15024\">",
"       figure 1",
"      </a>",
"      ). These glands make a hormone that helps control the amount of calcium in the blood. This hormone is called &ldquo;parathyroid hormone,&rdquo; or &ldquo;PTH.&rdquo;",
"     </p>",
"     <p>",
"      Hyperparathyroidism is when your parathyroid glands make too much PTH. This causes too much calcium to build up in your blood. Primary hyperparathyroidism, the most common form of hyperparathyroidism, can happen when one or more of the glands get bigger than they should, or when a gland develops an abnormal growth. Cancer is another possible cause of hyperparathyroidism, but this is very rare.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25992216\">",
"      <span class=\"h1\">",
"       What are the symptoms of hyperparathyroidism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with this condition have no symptoms. But some people do have symptoms that might be related to having more calcium in their blood than normal. These symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain in the joints",
"       </li>",
"       <li>",
"        Feeling tired or weak",
"       </li>",
"       <li>",
"        Loss of appetite",
"       </li>",
"       <li>",
"        Feeling depressed",
"       </li>",
"       <li>",
"        Trouble concentrating",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your PTH and blood calcium levels get very high, you might get constipated, feel very thirsty, or urinate more often than usual. Some people have more serious symptoms, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Problems with how the kidneys work",
"       </li>",
"       <li>",
"        Kidney stones",
"       </li>",
"       <li>",
"        Weak bones",
"       </li>",
"       <li>",
"        Gout (a kind of arthritis) or other problems in the joints",
"       </li>",
"       <li>",
"        Chemical imbalances in the blood",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      &ldquo;Parathyroid crisis&rdquo; is a rare but serious problem. It can happen if you have hyperparathyroidism and get sick with something that causes you to lose fluids (like vomiting or diarrhea). This causes the amounts of PTH and calcium in the blood to go up suddenly. If this happens, you might have belly pain, nausea, and sometimes problems thinking clearly and staying alert. It is important to see a doctor or nurse right away if you have hyperparathyroidism plus lasting vomiting or diarrhea, and can't keep fluids down.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25992231\">",
"      <span class=\"h1\">",
"       Is there a test for hyperparathyroidism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. A doctor or nurse can tell if you have hyperparathyroidism by measuring the levels of PTH and calcium in your blood. Many people with hyperparathyroidism do not notice any symptoms. The condition is often found when a doctor or nurse does a blood test for some other reason.",
"     </p>",
"     <p>",
"      If you have hyperparathyroidism, your doctor or nurse might do other tests, too. You will probably get a special kind of X-ray to see if your bones are weaker than normal. Plus, you might get checked for kidney stones, if you have had kidney stones in the past.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25992246\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to help my condition?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Even if you do not have any symptoms, there are things you can do to help prevent problems:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Drink plenty of liquids, and try not to get dehydrated. This can help to prevent kidney stones.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Stay active. This can help keep your calcium levels normal and your bones healthy.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Try to get about 1000 milligrams of calcium each day. These tables show how much calcium is in certain foods and vitamin supplements (",
"        <a class=\"graphic graphic_table graphicRef67824 \" href=\"UTD.htm?28/58/29611\">",
"         table 1",
"        </a>",
"        and",
"        <a class=\"graphic graphic_table graphicRef70454 \" href=\"UTD.htm?36/37/37468\">",
"         table 2",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Try to get about 400 to 600 international units (IU) of vitamin D each day (",
"        <a class=\"graphic graphic_table graphicRef77982 \" href=\"UTD.htm?7/12/7372\">",
"         table 3",
"        </a>",
"        ). Not having enough vitamin D can weaken your bones.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Do not take certain medicines that can affect the amount of calcium in the blood. Your doctor or nurse can tell you which medicines to avoid.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Even if you feel healthy, your doctor or nurse should still check your blood calcium every 6 months. He or she will also do regular tests to check your kidneys and bones. (People whose bones are weakened because of their condition can get medicines to help protect their bones.)",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25992261\">",
"      <span class=\"h1\">",
"       How is hyperparathyroidism treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main treatment is surgery to remove the gland or glands that are causing the problem. (In most cases, surgery cures the hyperparathyroidism.) Still, people who have no symptoms do not always need surgery.",
"     </p>",
"     <p>",
"      You will most likely need surgery if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        The amount of calcium in your blood is much higher than normal;",
"       </li>",
"       <li>",
"        Your hyperparathyroidism is causing problems with your kidneys or bones;",
"       </li>",
"       <li>",
"        You are younger than 50; or",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        You are not able to get regular checkups and tests.",
"       </li>",
"      </ul>",
"     </p>",
