var title_f2_6_2157="Indications FNA";
var content_f2_6_2157=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F70513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F70513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Sonographic and clinical features of thyroid nodules and recommendations for FNA",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Nodule sonographic or clinical features",
"      </td>",
"      <td class=\"subtitle1\">",
"       Recommended nodule threshold size for FNA",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       High-risk history*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Nodule WITH suspicious sonographic features&bull;",
"      </td>",
"      <td>",
"       <p>",
"        &gt;5 mm",
"       </p>",
"       <p>",
"        Recommendation A",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Nodule WITHOUT suspicious sonographic features&bull;",
"      </td>",
"      <td>",
"       <p>",
"        &gt;5 mm",
"       </p>",
"       <p>",
"        Recommendation I",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Abnormal cervical lymph nodes",
"       </strong>",
"      </td>",
"      <td>",
"       <p>",
"        All&Delta;",
"       </p>",
"       <p>",
"        Recommendation A",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Microcalcifications present in nodule",
"       </strong>",
"      </td>",
"      <td>",
"       <p>",
"        &ge;1 cm",
"       </p>",
"       <p>",
"        Recommendation B",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Solid nodule",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       AND hypoechoic",
"      </td>",
"      <td>",
"       <p>",
"        &gt;1 cm",
"       </p>",
"       <p>",
"        Recommendation B",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       AND iso- or hyperechoic",
"      </td>",
"      <td>",
"       <p>",
"        &ge;1-1.5 cm",
"       </p>",
"       <p>",
"        Recommendation C",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Mixed cystic-solid nodule",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       WITH any suspicious ultrasound features&bull;",
"      </td>",
"      <td>",
"       <p>",
"        &ge;1.5-2.0 cm",
"       </p>",
"       <p>",
"        Recommendation B",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       WITHOUT suspicious ultrasound features",
"      </td>",
"      <td>",
"       <p>",
"        &ge;2.0 cm",
"       </p>",
"       <p>",
"        Recommendation C",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Spongiform nodule",
"       </strong>",
"      </td>",
"      <td>",
"       <p>",
"        &ge;2.0 cm&loz;",
"       </p>",
"       <p>",
"        Recommendation C",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Purely cystic nodule",
"       </strong>",
"      </td>",
"      <td>",
"       <p>",
"        FNA not indicated&sect;",
"       </p>",
"       <p>",
"        Recommendation E",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     MEN: multiple endocrine neoplasia; FMTC: familial medullary thyroid cancer.",
"     <br>",
"      * High-risk history: History of thyroid cancer in one or more first degree relatives; history of external beam radiation as a child; exposure to ionizing radiation in childhood or adolescence; prior hemithyroidectomy with discovery of thyroid cancer,",
"      <sup>",
"       18",
"      </sup>",
"      FDG avidity on PET scanning; MEN2/FMTC-associated RET protooncogene mutation, calcitonin &gt;100 pg/mL.",
"      <br>",
"       &bull; Suspicious features: microcalcifications; hypoechoic; increased nodular vascularity; infiltrative margins; taller than wide on transverse view.",
"       <br>",
"        &Delta; FNA cytology may be obtained from the abnormal lymph node in lieu of the thyroid nodule.",
"        <br>",
"         &loz; Sonographic monitoring without biopsy may be an acceptable alternative.",
"         <br>",
"          &sect; Unless indicated as therapeutic modality.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: American Thyroid Association (ATA) Guidelines Taskforce on Thyroid Nodules and Differentiated Thyroid Cancer, Cooper, DS, Doherty, GM, et al. Revised American Thyroid Association management guidelines for patients with thyroid nodules and differentiated thyroid cancer. Thyroid 2009; 19:1167. Copyright &copy; 2009 Mary Ann Liebert, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
